import React from 'react';
import './App.css';
import Products from './Products'

const App: React.FC = () => {
  return (
    <div className='App'>
      <header>
        <ul>
          <li>Home</li>
          <li>Products</li>
          <li>Services</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
